        <div class="main-metodologia__container">
            <div class="main-metodologia__container-title">
                <h1>A metodologia <strong> Algoritmux</strong></h1>
            </div>
            <div class="main-metodologia__container-subtitle">
                <h2>
                    Este flywheel  composto por trs ciclos concntricos que se reforam mutuamente, gerando um movimento
                    contnuo de crescimento <strong>(growth)</strong>. Cada ciclo representa uma camada que contribui para o
                    fortalecimento das estratgias de crescimento.
                </h2>
            </div>
            <div class="main-metodologia__container-group" id="ciclo-1">
                <div class="main-metodologia__container-group--left">
                    <h2>Ciclo<strong>1</strong></h2>
                    <img src="{{ asset('/images/Circulo1.png') }}" alt="Imagem">
                </div>
                <div class="main-metodologia__container-group--right">
                    <span>Tudo comea com a coleta e anlise de <strong>dados</strong>. Esta fase  essencial para embasar
                        as decises e identificar oportunidades. O uso inteligente dos dados permite construir hipteses
                        mais slidas e fundamentadas para o crescimento.</span>
                    <span>Com base nos dados coletados,  feita a <strong>modelagem</strong> de estratgias. Aqui, definimos
                        planos de ao e simulamos possveis cenrios, garantindo que as tticas escolhidas estejam bem
                        alinhadas com os objetivos do negcio.</span>
                    <span>Uma vez que identificamos o que funciona,  hora de <strong>escalar</strong>. Expandimos as
                        estratgias de sucesso para um maior pblico ou rea, buscando aumentar o impacto e gerar resultados
                        mais expressivos.</span>
                    <span> o momento de colocar o plano em prtica. Nesta fase, a modelagem  transformada em aes
                        concretas e campanhas. A <strong>execuo</strong> precisa ser gil e focada para que possamos medir
                        rapidamente o impacto.</span>
                    <span>Aps executar as estratgias, avaliamos os <strong>resultados</strong> obtidos. Esta etapa envolve
                        medir KPIs, coletar feedback e entender o impacto gerado, verificando se os objetivos foram
                        alcanados.</span>
                </div>
            </div>
            <div class="main-metodologia__container-group" id="ciclo-2">
                <div class="main-metodologia__container-group--left">
                    <span>O foco est em melhorar continuamente o <strong>produto</strong> ou servio, adaptando-o s
                        necessidades dos clientes e aprimorando suas funcionalidades. Um bom produto  o ponto de partida
                        para conquistar e fidelizar clientes.</span>
                    <span>Um produto de qualidade leva  construo de uma <strong>reputao</strong> slida. Aqui, nos
                        preocupamos com a percepo do cliente, a experincia do usurio e o fortalecimento da marca no
                        mercado, gerando confiana e credibilidade.</span>
                    <span>Com uma boa reputao estabelecida,  possvel <strong>expandir</strong> para novos mercados ou
                        pblicos. A expanso ocorre de forma mais eficiente quando o produto e a marca tm um posicionamento
                        claro e forte, permitindo conquistar novos espaos.</span>
                </div>
                <div class="main-metodologia__container-group--right">
                    <h2>Ciclo<strong>2</strong></h2>
                    <img src="{{ asset('/images/Circulo2.png') }}" alt="Imagem">
                </div>
            </div>
            <div class="main-metodologia__container-group" id="ciclo-3">
                <div class="main-metodologia__container-group--left">
                    <h2>Ciclo<strong>3</strong></h2>
                    <img src="{{ asset('/images/CircuiloGrowth.png') }}" alt="Imagem">
                </div>
                <div class="main-metodologia__container-group--right">
                    <p>No centro do flywheel est o conceito de <strong>Growth</strong>, que representa o objetivo final e o
                        motor que impulsiona todos os ciclos. Growth  a soma dos esforos coordenados de todos os ciclos
                        anteriores, buscando crescimento sustentvel e escalvel.</p>
                    <span>Growth  alimentado pelas prticas contnuas de otimizao do produto, construo de uma reputao
                        slida, execuo estratgica, e ampliao da escala com base nos resultados. Cada ciclo contribui
                        para criar um movimento constante de melhoria e crescimento.</span>
                </div>
            </div>
            <div class="main-metodologia__container-group" id="ciclo-total">
                <div class="main-metodologia__container-group--left">
                    <p>A metodologia <strong>Algoritmux</strong> representa um modelo contnuo de crescimento, onde cada
                        camada contribui e refora o movimento do ciclo. Os trs nveis trabalham juntos para garantir que
                        cada aspecto do processo de growth seja otimizado e potencializado. Isso permite que o crescimento
                        seja no apenas constante, mas tambm cada vez mais eficiente e sustentvel.</p>
                </div>
                <div class="main-metodologia__container-group--right">
                    <img src="{{ asset('/images/Ciclo.png') }}" alt="Imagem">
                </div>
            </div>
        </div>
    </main>
